import { useNavigate,NavLink } from "react-router-dom";
import styles from "./styles.module.css";
import Footer from "../footer/index";
import Cal from"../Calendar/cal";
import Pie from "../piechart/Pie";
import Line from "../Linegraph/Line"
const Main = () => {
	const navigate = useNavigate();
	const handleLogout = () => {
		navigate("/")
	};

	return (
		<div className={styles.main_container}>
			<nav className={styles.navbar}>
				{/* Left Section with Logo */}
				<h1 className={styles.nav_logo}>WealthWise</h1>

				{/* Right Section with Navigation Links and Logout Button */}
				<div className={styles.nav_links_container}>
					<div className={styles.nav_links}>
						{/* Home Link */}
						<NavLink
							to="/DashBoard"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							DashBoard
						</NavLink>

						{/* Courses Link */}
						<NavLink
							to="/Income"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Income
						</NavLink>

						{/* Contact Link */}
						<NavLink
							to="/Expenses"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Expenses
						</NavLink>

						{/* About Link */}
						<NavLink
							to="/SavingInvestment"
							className={({ isActive }) =>
								isActive ? `${styles.nav_link} ${styles.active}` : styles.nav_link
							}
						>
							Saving&Investment
						</NavLink>
					</div>

					{/* Logout Button */}
                    <div className="login-bar"><p className={styles.logoutBar}>|</p>
                    </div>
					<button className={styles.white_btn} onClick={handleLogout}>
                    Logout
					</button>
				</div>
			</nav>
			<div className={styles.con}>
			<div className={styles.money}>
				<div className={styles.Total}><h2>Total Income:<sect className={styles.num}>1000000</sect></h2>
				<h2>Total Expense:<sect className={styles.num2}>50000</sect></h2>
				</div><br/>
				<div className={styles.remain}><h2 >Remaining:<sect className={styles.num3}>50000</sect></h2></div>
			</div>
			<br/>
			<div className={styles.piechart}><Pie/></div>
			<br/>
			<div className={styles.cal}><Cal/></div>
			</div>
			<div className={styles.line}><Line/></div>
			<div className={styles.foot}><Footer/></div>
		</div>
	);
};

export default Main;
